        fun <T: Executable> createHooker(apiHooker: BridgeApi.Hooker<T>): Class<out XposedInterface.Hooker> {
            val lsposedParent = LSPosedHookerFactory::class.java.classLoader!!.parent
            val children = MemoryDexLoader.createClassLoaderWithDex(bytes, lsposedParent)
            val clazz = children.loadClass("art.qqlittleice.xposedcompat.transition.lsposed.LSPosedHooker")
