            instanceField.set(null, apiHooker)
            val classLoaderField = clazz.getDeclaredField("moduleClassLoader")
            classLoaderField.set(null, LSPosedHookerFactory::class.java.classLoader!!)
            val beforeCallbackClassField = clazz.getDeclaredField("beforeMethodInvokedCallbackClass")
            beforeCallbackClassField.set(null, BridgeApi.BeforeMethodInvokedCallback::class.java)
            val afterCallbackClassField = clazz.getDeclaredField("afterMethodInvokedCallbackClass")
